import React from 'react'
import "./filter.scss"

const Filter = (props) => {

    const { filterByConsumer, filterByConsultant, filterByEmployed, checkboxValue, setCheckboxValue, checkboxConsultant, setCheckboxConsultant, checkboxEmployed, setCheckboxEmployed } = props;

    return (
        <div>
            <label>Filter by Consumer</label>
            <input tchecked={checkboxValue}
	            onChange={() => setCheckboxValue(!checkboxValue)}
	            type="checkbox"/>

            <label>Filter by Consultant</label>
            <input checked={checkboxConsultant}
	            onChange={() => setCheckboxValue(!checkboxValue)}
	            type="checkbox"/>

            <label>Employed?</label>
            <input checked={checkboxValue}
	            onChange={() => setCheckboxValue(!checkboxValue)}
	            type="checkbox"/>
        </div>
    )
}

export default Filter
